import React from 'react'
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';


export default function Start() {
  return(
    <Container>
      <Grid
        container
        direction="column"
        justify="center"
        alignItems="center"
        style={{height: '100vh'}}
        spacing={20}
      >
        <Grid item>
          <Typography variant="h2" component="h1">Для больших проектов и маленьких задач</Typography>
        </Grid>
        <Grid item>
          <Button href='/auth' size="large">Вперед</Button>
        </Grid>
      </Grid>
    </Container>
  )
}
